records.addlTxt:
Defendant Joshua Timothy Hummel in court with attorney Calvin R. Malone.  Defendant Joshua Timothy Hummel in custody.  Joanne L. Hardtke appeared for the State of Wisconsin.  Deputy Court Clerk: dds.

Sentencing proceeded.  Statements made by State, defense, and defendant. 

The Court sentenced the defendant to a MAXIMUM TERM OF IMPRISONMENT of 8 YEARS, CONCURRENT to Ozaukee case 14CF85, CONSECUTIVE to any other sentence with credit for 0 days served. The INITIAL TERM OF CONFINEMENT in the Wisconsin State Prison System is 4 YEARS.  The MAXIMUM TERM OF EXTENDED SUPERVISION IS 4 YEARS.

The defendant IS eligible for the Challenge Incarceration Program and the Substance Abuse Program.

CONDITIONS OF EXTENDED SUPERVISION:
*Obtain Mental health assessment and successfully complete follow-up treatment;
*Take any prescription medication only in the manner/dosage as prescribed by a treating physician;
*Obtain AODA assessment and successfully complete follow-up treatment;
*Cooperate with random urine screens;
*No drug dealing or association with drug community (drug users/dealers or drug houses);
*Cooperate with any and all rules set forth by the probation agent;
*No new law violations rising to the level of probable cause;
*No contact with Lauren B. or CVS Pharmacy located at 9220 W. Greenfield Ave.;
*Obtain/maintain full time employment or full time school and part time employment;
*Participate in Cognitive Thinking program;
*Pay all supervision fees;
*Provide DNA sample if not previously done so- pay surcharge;
*Pay all applicable mandatory surcharges, fees, assessments, and costs; 

The Court finds the state in compliance with victim rights legislation.  The Court ordered restitution in the stipulated amount of $3,093 payable to CVS Pharmacy- to be paid before court costs.  The Court orders restitution in this case to be paid after restitution paid to the victim in case 13CF4017.  The Court ordered that all financial obligations and restitution be paid through collection of sums by the Department of Corrections from 25% of funds under Sec. 973.05(4)(b) and as a condition of extended supervision.  Any amount remaining due and owing is subject to civil judgment.  Appeal rights given.
